import React from 'react';
import logo from './logo.svg';
import './App.css';

function Header() {
  return (
    <div className="App">
      <header className="App-header">
        This is a header!
      </header>
      <p className="App-logo"> FUN! </p>      
    </div>
  );
}

export default Header;
